	<script src="VersionManager.js" type="text/javascript"></script>
</head>

<body>
<script>
	var _target = (function(){return this;})();
	var _before = {};
	for (var p in _target) {
		_before[p] = true;
	}
</script>
<script src="prototype-1.6.0.3.js"></script>
<script>
			(function(){
				var _after = {};
				for (var p in _target) {
					_after[p] = true;
				}
				
				document.write("[");
				for (var p in _after) if (_after.hasOwnProperty(p)) {
					if (!(p in _before)) document.write("'"+p+"', ");
					
				}
				document.write("];");
			})();
        </script>
</body>
